SET NOCOUNT ON


USE master 
GO 


IF  EXISTS (SELECT * FROM sys.databases WHERE name = N'data_analysis_facebook') 
DROP DATABASE [data_analysis_facebook]
GO 


CREATE DATABASE [data_analysis_facebook]
GO 


USE [data_analysis_facebook]
GO


CREATE TABLE [dbo].[facebook_games](
	[game_id] [int] PRIMARY KEY,
	[game_name] [varchar](50) NULL,
	[game_version] [varchar](50) NULL,
	[game_category] [varchar](50) NULL,
	[created_by_company] [varchar](50) NULL,
	[creation_date] [date] NULL)
GO 


CREATE TABLE [dbo].[facebook_members](
	[member_id] [int] PRIMARY KEY,
	[full_name] [varchar](50) NULL,
	[email] [varchar](50) NULL,
	[gender] [varchar](50) NULL,
	[job_title] [varchar](50) NULL,
	[company] [varchar](50) NULL,
	[country] [varchar](50) NULL,
	[city] [varchar](50) NULL,
	[member_since] [date] NULL,
	[birth_date] [date] NULL,
	[payment_method_credit_type] [varchar](50) NULL,
	[payment_method_credit_number] [varchar](50) NULL)
GO




CREATE TABLE [dbo].[friendships](
	[member_id] [int] NOT NULL,
	[friend_id] [int] NOT NULL,
 CONSTRAINT [friendships_pk] PRIMARY KEY ([member_id],[friend_id]))
GO




CREATE TABLE [dbo].[games_and_players](
	[member_id] [int] NOT NULL,
	[game_id] [int] NOT NULL,
	[amount_spent] [varchar](50) NULL,
 CONSTRAINT [games_players_pk] PRIMARY KEY ([member_id],[game_id]))
 GO




